import React, { useMemo } from 'react';
import { useTable } from 'react-table';
import SAMPLE_DATA from './../../../public/Sample.json';

const COLUMNS = [
  {
    Header: 'ID',
    accessor: 'id'
  },
  {
    Header: 'First Name',
    accessor: 'first_name'
  },
  {
    Header: 'Last Name',
    accessor: 'last_name'
  },
  {
    Header: 'Email',
    accessor: 'email'
  },
  {
    Header: 'Gender',
    accessor: 'gender'
  }
]

const BasicTable = () => {
  const columns = useMemo(() => COLUMNS, [])
  const data = useMemo(() => SAMPLE_DATA, [])
  useTable({
    columns: COLUMNS,
    data: SAMPLE_DATA
  });

  return(
    <h5>
      TableList
    </h5>
  )
}

export default BasicTable;
